import React from 'react';
import logo from './logo.svg';
import './App.css';
import User from './User/User';
const numberOfUsers = [0,1,2,3]
function App() {
  return (
<div className="listUsers">
    {numberOfUsers.map(item => <User key={`user${item}`} usernumber={item}/>)}
  </div>
  );
}

export default App;
